  `phone` varchar(11) COLLATE utf8_bin NOT NULL COMMENT '手机号（登陆用）',
  `password` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '登陆密码',
  `image` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '用户头像',
  `nickname` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '用户昵称（登陆用）注册时自动生成一个可修改',
