  `company` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '公司名称',
  `level` varchar(12) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '用户等级：''0''=普通（默认0）',
  `u_type` varchar(12) COLLATE utf8_bin DEFAULT '0' COMMENT '用户类型；''0''=散客，''1''=VIP用户（默认0）',
  `viptype` varchar(12) COLLATE utf8_bin DEFAULT NULL COMMENT '大客户分类：营地会员，社会会员，学校会员',
  `total_amout` float(20,2) DEFAULT '0.00' COMMENT '总消费金额，（默认0）',
  `sysuser_id` int(11) DEFAULT NULL,
  `ip` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `sqlname` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `sqlpwd` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `is_sub_user` int(11) DEFAULT NULL,
  `access_token` varchar(512) COLLATE utf8_bin DEFAULT NULL,
  `refresh_token` varchar(512) COLLATE utf8_bin DEFAULT NULL,
  `expires_in` int(30) DEFAULT NULL,
  `openid` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `scope` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `baby_name` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `baby_sex` int(1) DEFAULT '0',
  `baby_birthday` date DEFAULT NULL,
  `credit_count` int(12) DEFAULT '0' COMMENT '积分（暂时）',
  `children` varchar(256) COLLATE utf8_bin DEFAULT NULL,
  `from_alliance` int(12) DEFAULT NULL COMMENT '从哪个加盟商处注册的',
  `from_user` int(12) DEFAULT NULL,
  `puserid` int(12) DEFAULT NULL COMMENT '上线',
  `campsiteid` int(11) DEFAULT NULL,
  `class_grade` int(11) DEFAULT NULL,
  `idcardno` varchar(18) COLLATE utf8_bin DEFAULT NULL,
  `realname` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `schoolid` int(11) DEFAULT NULL,
  `username` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=557 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

