-- ----------------------------
-- Table structure for wechat_card
-- ----------------------------
DROP TABLE IF EXISTS `wechat_card`;
CREATE TABLE `wechat_card` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '微信卡券',
  `alliance_id` int(11) NOT NULL COMMENT '加盟商',
  `card_id` varchar(128) NOT NULL COMMENT '卡券创建成功后微信返回的cardId',
  `card_status` int(11) NOT NULL COMMENT '卡券状态 0-待投放 1-已投放',
  `card_type` varchar(32) NOT NULL COMMENT '卡券类型',
  `logo_url` varchar(256) NOT NULL COMMENT '卡券的商户logo，建议像素为300*300',
  `brand_name` varchar(36) NOT NULL COMMENT '商户名字,字数上限为12个汉字',
  `code_type` varchar(32) NOT NULL COMMENT '码型',
  `title` varchar(27) NOT NULL COMMENT '卡券名',
  `color` varchar(16) NOT NULL COMMENT '卡券颜色',
  `notice` varchar(48) NOT NULL COMMENT '卡券使用提醒',
  `description` varchar(3072) NOT NULL COMMENT '卡券使用说明',
  `quantity` int(11) NOT NULL COMMENT '卡券库存的数量',
  `date_type` varchar(32) NOT NULL COMMENT '使用时间的类型：固定日期区间、固定时长',
  `begin_timestamp` bigint(20) NOT NULL COMMENT 'type为DATE_TYPE_FIX_TIME_RANGE时专用，表示起用时间（秒）',
  `end_timestamp` bigint(20) NOT NULL COMMENT 'type为DATE_TYPE_FIX_TIME_RANGE时专用，表示结束时间（秒）',
  `fixed_term` int(11) NOT NULL COMMENT 'type为DATE_TYPE_FIX_TERM时专用，表示自领取后多少天内有效，不支持填写0',
  `fixed_begin_term` int(11) NOT NULL COMMENT 'type为DATE_TYPE_FIX_TERM时专用，表示自领取后多少天开始生效，领取后当天生效填写0',
  `use_custom_code` int(11) DEFAULT NULL COMMENT '是否自定义Code码 。true：1，false：0',
  `get_custom_code_mode` varchar(32) DEFAULT NULL,
  `bind_openid` int(11) DEFAULT NULL COMMENT '是否指定用户领取 true：1，false：0',
  `service_phone` varchar(24) DEFAULT NULL COMMENT '客服电话',
  `location_ids` varchar(256) DEFAULT NULL COMMENT '门店位置，以逗号分隔的字符串',
  `use_all_location` int(11) DEFAULT NULL COMMENT '设置本卡券支持全部门店，与location_id_list互斥',
  `center_title` varchar(18) DEFAULT NULL COMMENT '卡券顶部居中的按钮，仅在卡券状态正常(可以核销)时显示',
  `center_sub_title` varchar(24) DEFAULT NULL COMMENT '显示在入口下方的提示语 ，仅在卡券状态正常(可以核销)时显示',
  `center_url` varchar(128) DEFAULT NULL COMMENT '顶部居中的url ，仅在卡券状态正常(可以核销)时显示',
  `center_app_brand_user_name` varchar(128) DEFAULT NULL COMMENT '卡券跳转的小程序的user_name，仅可跳转该公众号绑定的小程序',
  `center_app_brand_pass` varchar(128) DEFAULT NULL COMMENT '卡券跳转的小程序的path',
  `custom_url_name` varchar(15) DEFAULT NULL COMMENT '自定义跳转外链的入口名字',
  `custom_url` varchar(128) DEFAULT NULL COMMENT '自定义跳转的URL',
  `custom_url_sub_title` varchar(18) DEFAULT NULL COMMENT '显示在入口右侧的提示语',
  `custom_app_brand_user_name` varchar(128) DEFAULT NULL COMMENT '卡券跳转的小程序的user_name，仅可跳转该 公众号绑定的小程序',
  `custom_app_brand_pass` varchar(128) DEFAULT NULL COMMENT '卡券跳转的小程序的path',
  `promotion_url_name` varchar(15) DEFAULT NULL COMMENT '营销场景的自定义入口名称',
  `promotion_url` varchar(128) DEFAULT NULL COMMENT '入口跳转外链的地址链接',
  `promotion_url_sub_title` varchar(18) DEFAULT NULL COMMENT '显示在营销入口右侧的提示语',
  `promotion_app_brand_user_name` varchar(128) DEFAULT NULL COMMENT '卡券跳转的小程序的user_name，仅可跳转该公众号绑定的小程序',
  `promotion_app_brand_pass` varchar(128) DEFAULT NULL COMMENT '卡券跳转的小程序的path',
  `get_limit` int(11) DEFAULT NULL COMMENT '每人可领券的数量限制',
  `use_limit` int(11) DEFAULT NULL COMMENT '每人可核销的数量限制',
  `can_share` int(11) DEFAULT NULL COMMENT '卡券领取页面是否可分享，true:1 false:0',
  `can_give_friend` int(11) DEFAULT NULL COMMENT '卡券是否可转赠，true:1 false:0',
  `object_use_for` varchar(512) DEFAULT NULL COMMENT '购买xx可用类型门槛，仅用于兑换 ，填入后自动拼写购买xxx可用',
  `can_use_with_other_discount` int(11) DEFAULT NULL COMMENT '不可以与其他类型共享门槛，填写false时系统将在使用须知里 拼写“不可与其他优惠共享”，填写true时系统将在使用须知里 拼写“可与其他优惠共享”',
  `card_abstract` varchar(24) DEFAULT NULL COMMENT '封面摘要简介',
  `icon_url_list` varchar(256) DEFAULT NULL COMMENT '封面图片列表，仅支持填入一个封面图片链接',
  `image_url` varchar(256) DEFAULT NULL COMMENT '图片链接，必须调用 上传图片接口 上传图片获得链接，并在此填入， 否则报错',
  `text` varchar(512) DEFAULT NULL COMMENT '图文描述',
  `business_service` varchar(128) DEFAULT NULL COMMENT '商家服务类型，以逗号分隔',
  `advanced_type` varchar(24) DEFAULT NULL COMMENT '限制类型枚举值',
  `begin_hour` int(11) DEFAULT NULL COMMENT '当前type类型下的起始时间（小时）',
  `begin_minute` int(11) DEFAULT NULL COMMENT '当前type类型下的起始时间（分钟）',
  `end_hour` int(11) DEFAULT NULL COMMENT '当前type类型下的结束时间（小时）',
  `end_minute` int(11) DEFAULT NULL COMMENT '当前type类型下的结束时间（分钟）',
  `accept_category` varchar(512) DEFAULT NULL COMMENT '代金券专用，指定可用的商品类目，填入后将在券面拼写适用于xxx',
  `reject_category` varchar(512) DEFAULT NULL COMMENT '代金券专用，指定不可用的商品类目，填入后将在券面拼写不适用于xxxx',
  `reduce_cost` int(11) DEFAULT NULL COMMENT '代金券专用，表示减免金额（单位为分）',
  `least_cost` int(11) DEFAULT NULL COMMENT '代金券专用，表示起用金额（单位为分）,如果无起用门槛则填0。',
  `discount` int(11) DEFAULT NULL COMMENT '折扣券专用，表示打折额度（百分比）。填30就是七折。',
  `gift` varchar(3072) DEFAULT NULL COMMENT '兑换券专用，填写兑换内容的名称。',
  `default_detail` varchar(3072) DEFAULT NULL COMMENT '优惠券专用，填写优惠详情',
  `deal_detail` varchar(3072) DEFAULT NULL COMMENT '团购券专用，团购详情',
  `background_pic_url` varchar(128) DEFAULT NULL COMMENT '商家自定义会员卡背景图',
  `prerogative` varchar(3072) DEFAULT NULL COMMENT '会员卡特权说明,限制1024汉字',
  `auto_activate` int(11) DEFAULT NULL COMMENT '设置为true时用户领取会员卡后系统自动将其激活，无需调用激活接口，详情见自动激活',
  `supply_bonus` int(11) DEFAULT NULL COMMENT '显示积分',
  `bonus_url` varchar(128) DEFAULT NULL COMMENT '设置跳转外链查看积分详情',
  `supply_balance` int(11) DEFAULT NULL COMMENT '是否支持储值',
  `balance_url` varchar(128) DEFAULT NULL COMMENT '设置跳转外链查看余额详情',
  `activate_url` varchar(128) DEFAULT NULL COMMENT '激活会员卡的url',
  `name_type` varchar(24) DEFAULT NULL COMMENT '会员信息类目半自定义名称',
  `name` varchar(24) DEFAULT NULL COMMENT '会员信息类目自定义名称',
  `url_type` varchar(128) DEFAULT NULL COMMENT '点击类目跳转外链url',
  `bonus_cleared` varchar(128) DEFAULT NULL COMMENT '积分清零规则',
  `bonus_rules` varchar(128) DEFAULT NULL COMMENT '积分规则',
  `balance_rules` varchar(128) DEFAULT NULL COMMENT '储值说明',
  `activate_app_brand_user_name` varchar(128) DEFAULT NULL COMMENT '激活会原卡url对应的小程序user_name',
  `activate_app_brand_pass` varchar(128) DEFAULT NULL COMMENT '激活会原卡url对应的小程序path',
  `wx_activate` int(11) DEFAULT NULL COMMENT '设置为true时会员卡支持一键开卡',
  `cost_money_unit` int(11) DEFAULT NULL COMMENT '消费金额。以分为单位。',
  `increase_bonus` int(11) DEFAULT NULL COMMENT '对应增加的积分',
  `max_increase_bonus` int(11) DEFAULT NULL COMMENT '用户单次可获取的积分上限',
  `init_increase_bonus` int(255) DEFAULT NULL COMMENT '初始设置积分',
  `cost_bonus_unit` int(11) DEFAULT NULL COMMENT '每使用5积分',
  `reduce_money` int(11) DEFAULT NULL COMMENT '抵扣xx元',
  `least_money_to_use_bonus` int(11) DEFAULT NULL COMMENT '抵扣条件，满xx元（这里以分为单位）可用',
  `max_reduce_bonus` int(11) DEFAULT NULL COMMENT '抵扣条件，单笔最多使用xx积分',
  `swipe_card` int(11) DEFAULT NULL COMMENT '是否设置该会员卡支持拉出微信支付刷卡界面',
  `pay_and_qrcode` int(11) DEFAULT NULL COMMENT '是否设置该会员卡中部的按钮同时支持微信支付刷卡和会员卡二维码',
  `need_push_on_view` int(11) DEFAULT NULL COMMENT '填写true为用户点击进入会员卡时推送事件',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='微信卡券';

-- ----------------------------
-- Records of wechat_card
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_material_image
-- ----------------------------
DROP TABLE IF EXISTS `wechat_material_image`;
CREATE TABLE `wechat_material_image` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `alliance_id` int(11) NOT NULL COMMENT '所属加盟商',
  `use_scene` int(11) NOT NULL COMMENT '素材使用场景',
  `media_id` varchar(256) DEFAULT NULL COMMENT '微信返回的图片素材ID',
  `wechat_img_url` varchar(256) NOT NULL COMMENT '微信服务器图片路径',
  `title` varchar(64) NOT NULL COMMENT '图片名称',
  `local_img_url` varchar(128) NOT NULL COMMENT '本地图片路径',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=158 DEFAULT CHARSET=utf8 COMMENT='微信素材图片';

-- ----------------------------
-- Records of wechat_material_image
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_poi
-- ----------------------------
DROP TABLE IF EXISTS `wechat_poi`;
CREATE TABLE `wechat_poi` (
  `sid` varchar(64) NOT NULL COMMENT '微信门店ID',
  `alliance_id` int(11) NOT NULL,
  `poi_status` int(11) DEFAULT '0' COMMENT '门店状态',
  `available_state` int(11) DEFAULT '0' COMMENT '门店可用状态',
  `update_status` int(11) DEFAULT '0' COMMENT '门店更新状态',
  `poi_id` varchar(64) DEFAULT NULL COMMENT '门店ID',
  `business_name` varchar(64) NOT NULL COMMENT '门店名称，不能为空，15个汉字或30个英文字符内',
  `branch_name` varchar(64) NOT NULL COMMENT '分店名称',
  `province` varchar(32) NOT NULL COMMENT '门店所在的省份（直辖市填城市名,如：北京 市） 10个字以内',
  `city` varchar(32) NOT NULL COMMENT '门店所在的城市 10个字 以内',
  `district` varchar(32) NOT NULL COMMENT '门店所在地区 10个字 以内',
  `address` varchar(128) NOT NULL COMMENT '门店所在的详细街道地址（不要填写省市信息）',
  `telephone` varchar(32) NOT NULL COMMENT '门店的电话（纯数字，区号、分机号均由“-”隔开）',
  `categories` varchar(128) NOT NULL COMMENT '门店的类型',
  `offset_type` int(11) NOT NULL COMMENT '坐标类型： 1 为火星坐标 2 为sogou经纬度 3 为百度经纬度 4 为mapbar经纬度 5 为GPS坐标 6 为sogou墨卡托坐标 注：高德经纬度无需转换可直接使用',
  `longitude` double NOT NULL COMMENT '门店所在地理位置的经度',
  `latitude` double NOT NULL COMMENT '门店所在地理位置的纬度',
  `photo_urls` text COMMENT '图片列表，不超过20张',
  `recommend` varchar(1024) DEFAULT NULL COMMENT '推荐品',
  `special` varchar(512) DEFAULT NULL COMMENT '特色服务',
  `introduction` varchar(1024) DEFAULT NULL COMMENT '商户简介',
  `open_time` varchar(32) DEFAULT NULL COMMENT '营业时间',
  `avg_price` int(11) DEFAULT NULL COMMENT '人均价格',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `result` varchar(32) DEFAULT NULL COMMENT '审核结果，成功success 或失败fail',
  `msg` varchar(512) DEFAULT NULL COMMENT '成功的通知信息，或审核失败的驳回理由',
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信门店';

-- ----------------------------
-- Records of wechat_poi
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_qrcode_putting_card
-- ----------------------------
DROP TABLE IF EXISTS `wechat_qrcode_putting_card`;
CREATE TABLE `wechat_qrcode_putting_card` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '投放卡券ID',
  `alliance_id` int(11) NOT NULL COMMENT '加盟商',
  `card_id` int(11) NOT NULL COMMENT '本地卡券ID',
  `wechat_card_id` varchar(64) NOT NULL COMMENT '微信卡券ID',
  `card_code` varchar(64) DEFAULT NULL COMMENT '卡券Code码',
  `openid` varchar(64) DEFAULT NULL COMMENT '指定领取者openid，只有该用户能领取',
  `action_name` varchar(64) DEFAULT NULL COMMENT '投放类型',
  `expire_seconds` bigint(20) DEFAULT NULL COMMENT '指定二维码的有效时间，范围是60 ~ 1800秒',
  `unique_code` int(11) DEFAULT NULL COMMENT '指定下发二维码，生成的二维码随机分配一个code，领取后不可再次扫描。',
  `outer_id` int(11) DEFAULT NULL COMMENT '领取场景值，用于领取渠道的数据统计',
  `outer_str` varchar(64) DEFAULT NULL COMMENT 'outer_id字段升级版本，字符串类型，用户首次领卡时，会通过领取事件推送 给商户',
  `ticket` varchar(256) NOT NULL COMMENT '获取的二维码ticket，凭借此ticket调用 通过ticket换取二维码接口 可以在有效时间内换取二维码。',
  `url` varchar(256) NOT NULL COMMENT '二维码图片解析后的地址，开发者可根据该地址自行生成需要的二维码图片',
  `show_qrcode_url` varchar(256) NOT NULL COMMENT '二维码显示地址，点击后跳转二维码页面',
  `code` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COMMENT='扫描二维码投放卡券';

-- ----------------------------
-- Records of wechat_qrcode_putting_card
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_user_consume_card
-- ----------------------------
DROP TABLE IF EXISTS `wechat_user_consume_card`;
CREATE TABLE `wechat_user_consume_card` (
  `id` varchar(64) NOT NULL COMMENT '用户核销卡券信息ID',
  `openid` varchar(64) NOT NULL COMMENT '领券方openid',
  `card_id` varchar(128) NOT NULL COMMENT '卡券ID',
  `user_card_code` varchar(128) NOT NULL COMMENT '卡券Code码',
  `consume_source` varchar(32) NOT NULL COMMENT '核销来源',
  `location_name` varchar(64) DEFAULT NULL COMMENT '门店名称，当前卡券核销的门店名称（只有通过自助核销和买单核销时才会出现该字段）',
  `location_id` int(11) DEFAULT NULL,
  `staff_open_id` varchar(64) DEFAULT NULL COMMENT '核销该卡券核销员的openid（只有通过卡券商户助手核销时才会出现）',
  `verify_code` varchar(16) DEFAULT NULL COMMENT '自助核销时 ，用户输入的备注金额',
  `remark_amount` decimal(8,2) DEFAULT NULL COMMENT '自助核销时 ，用户输入的备注金额',
  `outer_str` varchar(128) DEFAULT NULL COMMENT '开发者发起核销时传入的自定义参数，用于进行核销渠道统计',
  `create_time` datetime NOT NULL COMMENT '消息创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户核销卡券信息';

-- ----------------------------
-- Records of wechat_user_consume_card
-- ----------------------------

-- ----------------------------
-- Table structure for wechat_user_get_card
-- ----------------------------
DROP TABLE IF EXISTS `wechat_user_get_card`;
CREATE TABLE `wechat_user_get_card` (
  `id` varchar(64) NOT NULL COMMENT '用户领取卡券信息ID',
  `card_status` varchar(32) NOT NULL COMMENT '用户领取的卡券状态 0-',
  `openid` varchar(64) NOT NULL COMMENT '领券方openid',
  `card_id` varchar(128) NOT NULL COMMENT '卡券ID',
  `give_by_friend` int(11) NOT NULL COMMENT '是否为转赠领取，1-是 0-否',
  `friend_user_name` varchar(64) DEFAULT NULL COMMENT '当IsGiveByFriend为1时填入的字段，表示发起转赠用户的openid',
  `user_card_code` varchar(128) NOT NULL COMMENT 'code序列号',
  `old_user_card_code` varchar(128) DEFAULT NULL COMMENT '为保证安全，微信会在转赠发生后变更该卡券的code号，该字段表示转赠前的code',
  `outer_str` varchar(128) DEFAULT NULL COMMENT '领取场景值，用于领取渠道数据统计',
  `restore_member_card` int(11) NOT NULL COMMENT '用户删除会员卡后可重新找回，当用户本次操作为找回时，该值为1，否则为0',
  `union_id` varchar(128) NOT NULL COMMENT '领券用户的UnionId',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户领取卡券信息';

