INSERT INTO `information` VALUES ('1', '智慧营地', '<img width=\"242\" height=\"149\" title=\"1448449337075007197.jpg\" alt=\"背摔.jpg\" src=\"/tzz/static/upload/image/20151125/1448449337075007197.jpg\" width=\'242px\' height=\'149px\' />', '<p style=\"line-height: 37px; text-indent: 37px;\"><strong><span style=\"color: rgb(255, 102, 0); font-family: 华文行楷; font-size: 35px;\">白沙湖</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"></span>拓展培训基地位于登封与禹州交界处，距郑州市约2小时车程。是省会郑州、古都洛阳、重镇许昌三市的中心地带，207国道从景区南大门穿过。 白沙湖风景区是嵩岳旅游区的重要组成部分，她<embed type=\"application/x-shockwave-flash\" class=\"edui-faked-music\" pluginspage=\"http://www.macromedia.com/go/getflashplayer\" src=\"http://box.baidu.com/widget/flash/bdspacesong.swf?from=tiebasongwidget&url=&name=%E9%86%89%E8%8D%89%E5%8E%9F&artist=%E7%A7%91%E5%B0%94%E6%B2%81%E5%A7%90%E5%A6%B9&extra=&autoPlay=false&loop=true\" width=\"400\" height=\"95\" align=\"none\" wmode=\"transparent\" play=\"true\" loop=\"false\" menu=\"false\" allowscriptaccess=\"never\" allowfullscreen=\"true\"/>弥补了蜚声海内外的少林寺，中岳庙有山无水、有刹无澜的缺憾。景区内景观林立，登封市著名的八大景观有两处即位于此地。 <br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;此基地属于拓展培训中的场地培训场所。借助白沙湖本身的特点，基地建有东西两个训练场,在这里可以进行“高空跨越”、“勇攀天梯”、“相依为命”、“合力过桥”、“紧急逃生”、“扎筏泅渡”、&quot;高空电网&quot;、&quot;月球行走&quot;、&quot;雷区取水&quot;、&quot;盲人过障&quot;、“汉诺塔”等拓展培训中所有的拓展项目。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;基地可容纳200人同时训练，是河南百人以上训练团的首选基地。景区尚不对外开放，使您的培训免受游客的干扰；据郑州车程只有2小时，使您免受长时间颠簸之苦。<span style=\"font-family: 宋体; font-size: 19px;\"></span></p><p><img width=\"432\" height=\"320\" title=\"1448449345191032319.jpg\" style=\"width: 507px; height: 336px;\" alt=\"背摔.jpg\" src=\"/tzz/static/upload/image/20151125/1448449345191032319.jpg\"/><img title=\"1451025433690079589.jpg\" src=\"/tzz/static/upload/image/20151225/1451025433690079589.jpg\"/></p><p style=\"text-align: center;\"><video class=\"edui-upload-video  vjs-default-skin   video-js\" controls=\"\" preload=\"none\" width=\"840\" height=\"560\" src=\"/tzz/static/upload/editvideo/20151225/1451024854261085649.mp4\" data-setup=\"{}\"><source src=\"/tzz/static/upload/editvideo/20151225/1451024854261085649.mp4\" type=\"video/mp4\"/></video></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center;\"><iframe width=\"534\" height=\"344\" class=\"ueditor_baidumap\" src=\"http://101.200.212.208/tzz/static/assets/js/ace/dialogs/map/show.html#center=113.602918,34.799586&zoom=18&width=530&height=340&markers=113.631349,34.753488&markerStyles=l,A\" frameborder=\"0\"></iframe></p><p>&nbsp;</p>', '2016-01-09 15:41:16', '智慧营地引领拓展zhi界的发展', '2', null);
INSERT INTO `information` VALUES ('5', '发生的飞洒地方', '<img width=\"242\" height=\"149\" title=\"1448454860167099330.png\" alt=\"photo.png\" src=\"/tzz/static/upload/image/20151125/1448454860167099330.png\" width=\'242px\' height=\'149px\' />', '<p>爱的发撒旦法师打发舒服<img src=\"http://img.baidu.com/hi/jx2/j_0037.gif\"/></p>', '2015-11-25 21:16:27', '发发的撒', '4', null);
